import React from 'react';
import './Climb.css';
import carabiner from './carabiner-logo.svg';
import userLogo from './user-logo.svg';


const Climb = ({climbList}) => {

    return climbList.map((climb, index) => (
      <div className='climb-container'> 

        <div className='climb-data'>
          {climb.username}
        </div>
        <div className='climb-data'>
          {climb.date}
        </div>
        <div className='climb-data'>
          {climb.climbName}
        </div>
        <div className='climb-data'>
          {climb.gym}
        </div>
        <div className='climb-data'>
          {climb.climbType}
        </div>
        <div className='climb-data'>
          {climb.grade}
        </div>
        <div className='climb-data'>
          {climb.rating}
          <img src={carabiner} className='carabiner-logo' alt='carabiner' />
        </div>


      </div>

      ));



};

export default Climb;
